import React, { useState, useEffect } from 'react';

function Profile() {


    const [userName, setUserName] = useState('');

    useEffect(() => {
        setUserName('Ganesh');

    }, [])



    return (
        <div>
            <h2>{userName}</h2>
        </div>
    )
}

export default Profile
